Since the front-end is being created with Angular, the plugin is treated like a component. To shape the visual part of the plugin, configure the template.html file (holds the HTML components) and styles.less file (holds the style settings). template.html - HTML <p>Example</p> <!-- Create a line of text -->
<button (click)="_ng_click"> </button> <!-- Create a button with a method to be called from the components.ts file --> styles.less - LESS p { color: #FFFFFF;
} button { height: 20px; width: 50px;
}

27.body:
The HTML elements can be attached with any kind of functions, which need to be configured in the components.ts file. components.ts - Typescript, Angular import { Component } from '@angular/core'; // Import the Angular component that is necessary for the setup below @Component({ selector: 'example', // Choose the selector name of the plugin templateUrl: './template.html', // Assign HTML file as template styleUrls: ['./styles.less'] // Assign LESS file as style sheet file
}) export class ExampleComponent { // Create an example class for the method public _ng_click() { // Create a method for the button in template.html console.log('Hello World!'); // Initiate a console output }
}

28.body:
To expand the range of classes and methods the example plugin can make use of, modify the module.ts file. module.ts - Typescript, Angular import { NgModule } from '@angular/core'; // Import the Angular component that is necessary for the setup below
import { Example } from './component'; // Import the class of the plugin, mentioned in the components.ts file
import * as Toolkit from 'chipmunk.client.toolkit'; // Import Chipmunk Toolkit to let the module class inherit @NgModule({ declarations: [ Example ], // Declare which components, directives and pipes belong to the module imports: [ ], // Imports other modules with the components, directives and pipes that components in the current module need exports: [ Example ] // Provides services that the other application components can use
}) export class PluginModule extends Toolkit.PluginNgModule { // Create module class which inherits from the Toolkit module constructor() { super('Example', 'Create an example plugin'); // Call the constructor of the parent class }
} IMPORTANT: Make sure the PluginModule class inherits from Toolkit.PluginNgModule or else the modules won't be part of the plugin! Library management The library management of the plugin is defined in public_api.ts which manages and exports the public definitions of the plugin. In this example only the module.ts and component.ts files are being exported. public_api.ts - Typescript export * from './lib/component'; // Export the main component of the plugin
export * from './lib/module'; // Export the module file of the plugin IMPORTANT: Exporting the component and module is required by Angular and necessary for the plugin to work!

