In this example a plugin with a button will be created. When the button is pressed, a popup with a message (provided by the plugin) will be shown along with a button to close the popup window. Popup component /popup/template.html - HTML <p>{{msg}}</p> <!-- Show message from component --> /popup/styles.less - LESS p { color: #FFFFFF;
} /popup/components.ts - Typescript, Angular import { Component, Input } from '@angular/core'; // Import necessary components for popup @Component({ selector: 'example-popup-com', // Choose the selector name of the popup templateUrl: './template.html', // Assign HTML file as template styleUrls: ['./styles.less'] // Assign LESS file as style sheet file}) export class PopupComponent { constructor() { } @Input() public msg: string; // Expect input from host component
} Plugin component template.html - HTML <p>Example</p>
<button click="_ng_popup()"></button> <!-- Button to open popup --> styles.less - LESS p { color: #FFFFFF;
} components.ts - Typescript, Angular import { Component, Input } from '@angular/core'; // Import necessary components for plugin
import { PopupComponent } from './popup/components'; // Import the popup module @Component({ selector: 'example', // Choose the selector name of the popup templateUrl: './template.html', // Assign HTML file as template styleUrls: ['./styles.less'] // Assign LESS file as style sheet file}) export class ExampleComponent { @Input() public api: Toolkit.IAPI; // API assignment @Input() public msg: string; // Expect input from host component constructor() { } public _ng_popup() { this.api.addPopup({ caption: 'Example', component: { factory: PopupComponent, // Assign the popup module to factory inputs: { msg: 'Hello World!', // Provide the popup with a message as input } }, buttons: [ // Create a button on the popup to close it { caption: 'Cancel', handler: () => { this.api.removePopup(); // Close popup } } ] }); }
} NOTE: For more information how the API works check out Chapter 5 - API

