PluginIPC provides methods to establish the communication between the front- and back-end. For a better explanation of how to communicate, code snippets of main.ts are being shown. Aside from importing the necessary components, it is also important subscribe to the events with a method which handles the message traffic. import PluginIPCService from 'chipmunk.plugin.ipc'; // Plugin IPC
import { IPCMessages } from 'chipmunk.plugin.ipc'; // Class to create messages ... constructor() { this._onIncomeRenderIPCMessage = this._onIncomeRenderIPCMessage.bind(this); // Bind the function the will receive the messages from the front-end PluginIPCService.subscribe(IPCMessages.PluginInternalMessage, this._onIncomeRenderIPCMessage); // Subscribe to the messages from the front-end } private _onIncomeRenderIPCMessage(message: IPCMessages.PluginInternalMessage, response: (res: IPCMessages.TMessage) => any) { // Function that will handle the incoming messages ... } The method that takes care of the messages is _onIncomeRenderIPCMessage, which then decides which action is to being taken in comply with the commmand. In chapter 3 was a reference to two buttons which either send or make a request to the back-end. In accordance to the request that is being made by the front-end, the back-end responds with a message back to the front-end containing a string. Similar to the request , upon receiving sent as a command from the front-end, the back-end creates a new message and also sends a message containing a string without expecting a response from the front-end. private _onIncomeRenderIPCMessage(message: IPCMessages.PluginInternalMessage, response: (res: IPCMessages.TMessage) => any) { // Process commands switch (message.data.command) { case 'request': return response(new IPCMessages.PluginInternalMessage({ // Respond to the request from the front-end data: { // data can contain any kind of data to be sent msg: '\'request\' was successful!' // Attach a message to the response }, token: message.token, stream: message.stream })); case 'sent': // Send a message to the front-end without expecting any kind of response return PluginIPCService.sendToPluginHost(message.stream, { data: { msg: '\'sent\' was successful!' }, event: 'sent', streamId: message.stream }) default: this._logger.warn(`Unknown command: ${message.data.command}`); }
} For a better understanding and deeper insight of PluginIPC refer to sandbox/myplugin/process/node_modules/chipmunk.plugin.ipc/dist/node.libs/chipmunk.plugin.ipc/src/ipc/plugin.ipc.service.d.ts.

49.body:
Since most operations triggered in chipmunk can take some time (mostly working on big files or streams), all functions should use events/messages to inform the chipmunk about progress, results, errors and warnings. Below is a description of how to achieve that. your function should take 2 additional parameters: update_channel: mpsc::Sender<IndexingResults<T>>,
shutdown_rx: Option<mpsc::Receiver<()>>, both are rust mpsc channels that can be used for communication between the client using your function and the function itself. the update_channel is the sender-end of a mpsc channel which means that your function can use it to send messages to the function-user. So what should/can your function send? There are 2 basic categories of events you should send: IndexingProgress<T> messages or Notification messages. We use the Result type to make the distinction. Kind of like the Either type in haskell. Either we send an Ok(event) or an Err(notification). pub type IndexingResults<T> = std::result::Result<IndexingProgress<T>, Notification>; In case of an IndexingProgress, you can either send an actual result (GotItem), or report on the lifecycle state of the function (indicating progress or the end of the function) pub enum IndexingProgress<T> { GotItem { item: T }, Progress { ticks: (usize, usize) }, Stopped, Finished,
} Note that for indicating that the function is finished, there are 2 events (Stopped and Finished) This is to distinguish between "we were stopped from outside" and "we really did finish"). For all errors that occure and should be communicated to chipmunk, you can send a Notification. This is a struct that contains the severity, some content and optionally a line number to indicate at which line the error has occurred. pub struct Notification { pub severity: Severity, pub content: String, pub line: Option<usize>,
}
